import { useState } from "react";

export default function({ cards }) {
  let [step, setStep] = useState(0);

  return (
        <div>
          id: { cards[step].id }
          <br/>
          word: { cards[step].word}
          <br/>
          <button onClick={() => step++}>NEXT</button>
        </div>
  );
}
